import React from 'react';

class pokemonDescription extends React.Component {
  render() {
    const { name, type, weight, image } = this.props;
    return (
      <div>
        <p>{name}</p>
        <p>{type}</p>
        <p>{weight}</p>
        <img src={image}></img>        
      </div>
    );
  }
}

export default pokemonDescription;
